    <div className="text-center" style={{background:'gray'}}>
        <h1 > Learn with satyam-pinky</h1>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.
         Iste temporibus aliquid repellendus doloremque maiores dolorem eos.
          Architecto ipsa odit fugiat officia vitae blanditiis assumenda repellat praesentium omnis.
           Voluptatibus, doloremque dolor.</p>
           <Container>
               <Button color="primary" outline>search here </Button>
           </Container>
    </div>
    </>);
}
export default Home;
